import 'package:whatsappsendnumber/core/db/features/number_phone_data_base/data_base/numbers_phone_daba_base_impl.dart';import 'package:whatsappsendnumber/features/history/data/data_source/phone_number_data_source.dart';import 'package:whatsappsendnumber/features/history/domain/models/phone_number_output.dart';import 'package:whatsappsendnumber/features/history/framework/data/config/models/number_phone_local.dart';class PhoneNumberDataDataSourceImpl implements PhoneNumberDataDataSource {  final NumbersPhoneImpl _numbersPhoneImpl;  PhoneNumberDataDataSourceImpl(this._numbersPhoneImpl);  @override  Future<void> deleteAllPhoneNumber() async {    _numbersPhoneImpl.deleteAllPhoneNumber();  }  @override  Future<void> deletePhoneNumber(int identifier) async {    final result = await _numbersPhoneImpl.deletePhoneNumber(identifier);    print("ROW DELETE -> $result");  }  @override  Future<PhoneNumberOutPut> getPhoneNumber() async {    final result = await _numbersPhoneImpl.getPhoneNumber();    return result;  }  @override  Future<void> insertPhoneNumber(PhoneNumberLocal numberPhoneLocal) async {    await _numbersPhoneImpl.insertPhoneNumber(numberPhoneLocal);  }}